import React from 'react';
import Itemcard from "./Itemcard"; 
import data from "./data";
import "./Home.css";
import { Carousel } from 'react-bootstrap';
const Home = () =>{
    
    return (
        <div className="container"><div>
        <h2 className="text-center mt-3">Add more members and be strong the business.....!</h2>
        <section className="py-4 container">
            <div className="row justify-content-center">
                {data.ItemData.map((item,index)=>{
                    return (
                        <Itemcard img={item.img} title={item.title} desc={item.desc} more={item.more} button={item.button} key={index}/>
                      

                    )
                })}
             
            </div>
        </section>
        </div><br/><br/>
    
            
       
        <Carousel variant="dark">
  <Carousel.Item>
    <img
      className="d-block w-100"
    
      alt="First slide"
    />
    <Carousel.Caption>
      <h5>First slide label</h5>
      <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img
      className="d-block w-100"
     
      alt="Second slide"
    />
    <Carousel.Caption>
      <h5>Second slide label</h5>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item>
    <img className="d-block w-100" src="../assets/slide3.jpg"/>
    <Carousel.Caption>
      <h5>Third slide label</h5>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel></div>

    );
};

export default Home;
